      var pathSegmentsToKeep = 1;
      var l = window.location;
      var r = l.pathname.split('/').slice(1);
      var d = l.pathname.split('/').slice(1, 1 + pathSegmentsToKeep);
      var x = r.slice(pathSegmentsToKeep).join('/') + l.search + l.hash;
      var u = d.join('/') + '/' + x;
      var s = l.origin + '/' + u;
      window.location.replace(s);
    </script>
